  [],\n\t\"revision_timestamp\": \"2016-07-27T22:49:55.494737\",\n\t\"name\": \"narrative-reportquivira-national-wildlife-refuge-may-1-august-31-1957\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Quivira National
  Wildlife Refuge outlines Refuge accomplishments from May through August of 1957.
  The report begins by summarizing the weather conditions, water conditions,  food
  and cover, and wildfires during this period. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, predators, rodents, raptors, fish,
  and disease- is also covered. The Refuge development and maintenance section discusses
  physical developments and plantings. Resource management is outlined; topics include
  grazing, haying, fur harvesting, and timber removal. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, fishing, and violations.  Items of interest, photographs, and N-R forms
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
